export class User {
  constructor(
    public ime: string = "",
    public prezime: string = "",
    public korIme: string = "",
    public lozinka: string = "",
    public pol: string = "",
    public adresa: string = "",
    public telefon: string = "",
    public mejl: string = "",
    public tip: string = "",
    public aktivan:boolean = false,
    public tipSkole: string = "",
    public trenutniRazred: number = 0,
    public bezPitanje: {""},
    public safeResponse: string = "",


    public photo: string = "",

    public cv: string = "",
    public selectedSubjects: string[] = [],
    public selectedSubjectsGrades: string[] = [],
    public source: string = ""
  ) {}
}
